import React from "react";
import styles from "./Line.module.scss";
const Line = () => {
  return (
    <div>
      <div className={styles.line}>
        <div className={styles.button}>
          <div></div>
          <div></div>
        </div>
        <div className={styles.right}><div></div>Triết lý mà G-Store theo đuổi là gì</div>
      </div>
    </div>
  );
};

export default Line;
